import React, { Component } from 'react';

export default class ExercisesList extends Component {
  constructor(props) {
    super(props);

    this.onChangeEmail = this.onChangeEmail.bind(this);
    this.onChangePassword = this.onChangeDate.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      username: '',
      description: '',
      duration: 0,
      date: new Date(),
      users: []
    }
  }

  render() {
    return (
      <div>
        <p>You are on the Student Login page!</p>
      </div>
    )
  }
}
